import React from "react";

const SignUp=()=>{
    return(
        <div>
            <h1>Register HERE</h1>
            <input type="text" placeholder="Enter Name"/>
            <input type="text" placeholder="Enter Password"/>
            <input type="text" placeholder="Confirm Password"/>
            <input type="text" placeholder=""/>
        </div>
    )
}

export default SignUp;
